import React from "react";

function TaskListItem(props) {
  return (
    <li onClick={props.onTaskClick}>
      <div>&nbsp;&nbsp;&nbsp;&nbsp;{props.task.Task_title}&nbsp;&nbsp;&nbsp;&nbsp;{new Date(props.task.Create_date).toLocaleDateString()}</div>
    </li>
  );
}

export default TaskListItem;
